/*Table structure for table `membergyminfo` */

DROP TABLE IF EXISTS `membergyminfo`;

CREATE TABLE `membergyminfo` (
  `regId` decimal(10,0) NOT NULL,
  `subscription` varchar(100) DEFAULT NULL,
  `paidAmount` decimal(10,0) DEFAULT NULL,
